def createNode(String meetingId,String surveyLink){
    String bannerCopy = "Help us improve this meeting.";
    String bannerCopyBold = "Your Opinion Matters!";
    String buttonCopy = "TAKE SURVEY";

    println(meetingId+" "+surveyLink);
    String parentLocation = "/content/vtkcontent/en/vtk-survey-links/jcr:content/content/middle/par";
    Resource parentLocationResource = resourceResolver.resolve(parentLocation)
    Node parentLocationNode= parentLocationResource.adaptTo(Node.class);
    String nodePrefix = "vtk_survey_links";
    //Date latestDate = new Date();
    int randomNo = Math.abs(new Random().nextInt() % 600000) + 1;
    println(nodePrefix+"_"+randomNo);
    String nodeName = nodePrefix+"_"+randomNo;
    Node meetingIdNode = parentLocationNode.addNode(nodeName,"nt:unstructured");
    meetingIdNode.setProperty("sling:resourceType","girlscouts-vtk/components/vtk-survey-links");
    meetingIdNode.setProperty("bannerCopy",bannerCopy);
    meetingIdNode.setProperty("bannerCopyBold",bannerCopyBold);
    meetingIdNode.setProperty("buttonCopy",buttonCopy);
    meetingIdNode.setProperty("meetingid",meetingId);
    meetingIdNode.setProperty("surveyLink",surveyLink);
    save()

}

